    cnt_odd_pattern = 0
    for c in range(1, cnt_odd_bag + 1, 2):
        cnt_odd_pattern += comb(cnt_odd_bag, c)
    cnt_even = cnt_even_pattern * cnt_odd_pattern
    if P == 1:
        print(cnt_even)
